INSERT INTO `posts` VALUES (1,'/uploads/post/فهيرة_1601982714.jpg','إيران: على أرمينيا الانسحاب من المناطق الأذرية المحتلة والتدخل الفرنسي غير مقبول','دعت إيران أرمينيا للانسحاب مما سمتها المناطق الأذرية المحتلة، في وقت أبدت فيه الأمم المتحدة وروسيا قلقها من تصعيد القتال ودعتا للحوار عبر مجموعة مينسك، بينما تشترط أذربيجان ضمانات لوقف القتال','فهيرة','/uploads/post/writerImage/فهيرة_1601982714.jpg','write1@test.com',NULL,NULL,1,'سياسة','<h2 align=\"right\">قلق أممي وروسي</h2>\r\n<p align=\"right\">من جانبه، دان الأمين العام للأمم المتحدة أنطونيو غوتيريش استمرار \r\nتصعيد العنف في منطقة قره باغ، رغم النداءات المتكررة من المجتمع الدولي \r\nلوقف القتال على الفور.</p>\r\n<p align=\"right\">وقال ستيفان دوجاريك المتحدث باسم الأمين العام إن الأخير يشعر بقلق \r\nبالغ إزاء التقارير التي تتحدث عن اتساع نطاق الأعمال العدائية واستهداف \r\nمناطق مأهولة، مذكرا الأطراف بالتزاماتها بموجب القانون الدولي.</p>\r\n<p align=\"right\">وجدد الأمين العام الأممي التأكيد على أنه لا يوجد حل عسكري للصراع، وحث الجانبين على وقف جميع الأعمال العدائية على الفور.</p>\r\n<p align=\"right\">وناشد غوتيريش الجهات الفاعلة الإقليمية والدولية ممارسة نفوذها لإنهاء \r\nالقتال بشكل عاجل، والعودة إلى المفاوضات تحت رعاية مجموعة مينسك التابعة \r\nلمنظمة الأمن والتعاون في أوروبا.</p>\r\n<p align=\"right\">وفي هذا السياق، شدد وزير الخارجية الروسي سيرغي لافروف -في اتصال هاتفي\r\n مع نظيره الأذري جيهون بيراموف- على قلقه إزاء تصاعد وتيرة الاشتباكات في \r\nخط التماس، ووقوع ضحايا في صفوف المدنيين.</p>\r\n<p align=\"right\">وشدد لافروف على ضرورة الإسراع في وقف إطلاق النار بين أذربيجان \r\nوأرمينيا، مبينا أن موسكو تشجع على استئناف المحادثات في إطار مجموعة \r\nمينسك، مبديا استعداد بلاده لاستضافة لقاء بين وزيري خارجية أذربيجان \r\nوأرمينيا في إطار تلك المجموعة.</p>\r\n<p align=\"right\">وفي الإطار، أفاد بيان صادر عن الرئاسة الروسية (الكرملين)، بإجراء \r\nالرئيس الروسي فلاديمير بوتين اتصالا هاتفيا مع رئيس الوزراء الأرمني نيكول\r\n باشينيان، وكرر دعوته لوقف الاشتباكات على الفور.لكن الرئيس التركي رجب طيب أردوغان أكد أمس أن مجموعة مينسك -التي تضم \r\nالولايات المتحدة وفرنسا وروسيا- أوصلت مشكلة إقليم ناغورني قره باغ المحتل\r\n من أرمينيا إلى طريق مسدود بدل حلها.<img style=\"float: left; width: 100%;\" src=\"data:image/png;base64,\" data-filename=\"image.png\" class=\"note-float-left\"></p>\r\n<p align=\"right\">لكن الرئيس التركي رجب طيب أردوغان أكد أمس أن مجموعة مينسك -التي تضم \r\nالولايات المتحدة وفرنسا وروسيا- أوصلت مشكلة إقليم ناغورني قره باغ المحتل\r\n من أرمينيا إلى طريق مسدود بدل حلها.</p>\r\n<p align=\"right\">وقال أردوغان -في خطاب متلفز- إن دعم نضال أذربيجان من أجل تحرير أراضيها المحتلة واجب على كل دولة شريفة.</p>\r\n<p align=\"right\">وفي تطور سياسي آخر، قال الرئيس الأذري إلهام علييف إن بلاده أعلنت بشكل\r\n واضح شروطها لوقف إطلاق النار، وهي: انسحاب أرمينيا من الأراضي التي \r\nاحتلتها -بحسب وصفه- وأن يقدم الوسطاء ضمانات جدية جدا لذلك.</p>\r\n<p align=\"right\">وأكد علييف أن على الوسطاء في حل الأزمة أن يسلّموا بلاده جدولا زمنيا \r\nلانسحاب أرمينيا من هذه الأراضي التي قال إن السلام لا يتحقق إلا بتسليمها \r\nلبلاده، مؤكدا أن ما تريده باكو هو إيجاد حل حقيقي للأزمة، وألا مطامع \r\nلديها في أرمينيا.</p>',1,'2020-10-06 15:11:54','2020-10-10 17:53:08');
INSERT INTO `posts` VALUES (2,'/uploads/post/image1601985133.png','كيف أثرت إصابة ترامب بكورونا على قطاع الأسهم الأميركية؟','بعد دخول الرئيس الأميركي دونالد ترامب مستشفى والتر ريد العسكري إثر إصابته بفيروس كورونا، بدأت أسواق المال الأميركية يوم الاثنين على ارتفاع واضح عكَس ازدياد ثقة المستثمرين في تحسن صحة الرئيس.','محمد المنشاوي','/uploads/post/writerImage/image1601985133.jpg','write3@test.com',NULL,NULL,1,'اقتصاد','<p align=\"right\"><img style=\"width: 374.738px; float: right; height: 250.817px;\" src=\"data:image/png;base64,\" data-filename=\"image.png\" class=\"note-float-right\">بعد عطلة نهاية الأسبوع التي شهدت دخول الرئيس دونالد ترامب مستشفى \r\nوالتر ريد العسكري إثر إصابته بفيروس كورونا التي أُعلن عنها يوم الخميس \r\nالماضي، بدأت أسواق المال الأميركية -أمس الاثنين- على ارتفاع واضح عكس \r\nازدياد ثقة المستثمرين في تحسن صحة الرئيس</p>\r\n<p align=\"right\">وخرج ترامب من المستشفى العسكري القريب من العاصمة واشنطن هذا اليوم \r\nسيرا مرتديا كمامة، ثم استقل سيارة خاصة أقلته نحو مربض الطائرات، حيث \r\nأقلته المروحية الرئاسية إلى البيت الأبيض في دقائق قليلة، لأن المسافة لا \r\nتتجاوز بضعة كيلومترات.</p>\r\n<p align=\"right\">وجاءت هذه الأنباء بعد فترة توتر قصيرة عبّر فيها خبراء ماليون عن قلقهم\r\n المبكر مما أعلنه أطباء ترامب من تلقيه دواء بديكساميثاسون والإستيرويد \r\nالموصى به للحالات الشديدة المصابة بفيروس كورونا، وأضافت أنباء تلقي \r\nالرئيس الأوكسجين مرتين المزيد من التوتر في الأسواق.</p>\r\n<p align=\"right\">وتوقع خبير أسواق المال محمد العريان -في تغريدة له- أن يكون هذا أسبوعا\r\n فريدا في تفاصيله وتحركاته، وذلك بالنظر إلى تبعات صحة ترامب وآخر تطورات \r\nانتشار فيروس كورونا وما سيصدر عن مجلس الاحتياط الفدرالي</p><h2 align=\"right\">تصريحات ترامب وتغريداته</h2>\r\n<p align=\"right\">وبعد ساعات من إعلان ترامب إصابته بفيروس كورنا فجر يوم الجمعة الماضي، ترقّب الخبراء حركة أسواق المال صباح ذات اليوم.</p>\r\n<p align=\"right\">ودفع عدم اليقين من صحة الرئيس الأسواق لانخفاض طفيف للغاية، وسجّل مؤشر\r\n داو جونز ومؤشر ستاندرد آند بورز 500 تراجعا بسيطا عند فتح السوق في تمام \r\nالساعة 9:30 بتوقيت العاصمة واشنطن.</p>\r\n<p align=\"right\">وحاول الرئيس ترامب التأكيد على أنه في صحة جيدة طوال ساعات تعامل أسواق\r\n المال يوم الجمعة. وارتفع مؤشر داو جونز بعض الوقت قبل أن ينتهي بانخفاض \r\nقيمته 0.5% فقط، في حين انخفض مؤشر ستاندرد آند بورز بنسبة 1%، وتراجع مؤشر\r\n ناسداك لأسهم التكنولوجيا بمعدل%2.2</p><blockquote class=\"blockquote\"><p align=\"right\">وتعد هذه الانخفاضات مقبولة جدا في ظل حالة عدم اليقين بشأن صحة الرئيس \r\nترامب، وعند الأخذ في الحسبان ارتفاع مؤشر ناسداك منذ بداية العام بمعدل \r\nوصل إلى 23% حتى الآن، تكون هذا النسب جيدة جدا</p></blockquote>',1,'2020-10-06 15:23:40','2020-10-06 15:52:13'),(3,'/uploads/post/براء نزار ريان_1601983698.png','سعيد بن جبير أمهر لاعبي الشطرنج وكرة نسائية بدولة المماليك وتأسيس عثماني \"للألتراس\" المصري.. تاريخ الألعاب لدى المسلمين','في هذا المقال الذي نحسبه غير مسبوق في موضوعه مستوى ومحتوى؛ سندخل بكم عالم الألعاب في الحضارة الإسلامية لنستكشف ما وصلت إليه من مستوى فني محترف تنوعا وتنظيما وانضباطا وتشجيعا وانتشارا بين فئات المجتمع.','براء نزار ريان','/uploads/post/writerImage/براء نزار ريان_1601983698.jpg','write4@test.com',NULL,NULL,NULL,'ثقافة','<p align=\"right\"><img style=\"width: 25%; float: right;\" src=\"data:image/jpeg;base64,\" data-filename=\"4.jpeg\" class=\"note-float-right\"><br></p><p align=\"right\">للحياة في الحضارة الإسلامية وجوهٌ أخرى خلافَ ما هو شائع؛ فلم يكن \r\nالمسلمون فقط أهل حرب ونِزال رِكاب ومسجد ومدرسة وكِتاب، ودولة مترامية \r\nالأطراف ممطرة بالخراج مفعمة بالقوة زاهرة بالعمران، بل عرف المسلمون كذلك \r\nالهزل اللطيف واللعب النظيف، وضروبا من الرياضات البدنية والذهنية النابضة \r\nبالإمتاع والانتفاع.</p>\r\n<p align=\"right\">إنه جانب من التاريخ المغفْلَ يخلخل الصورة المنمَّطة لتاريخ المسلمين، \r\nالذي يراد اختزاله في صور مجتزَأة جائرة ساهمت للأسف الدراما ومناهج \r\nالتاريخ الحديثة المستنبَتة في تكريسها وتركيزها في الأذهان؛ فغابت تفاصيل \r\nالمرح واللعب من تلك الدراما، وبَهَتَتْ تفاصيل حياة المسلم اليومية \r\nالإنسانية العادية.</p>\r\n<p align=\"right\">لقد كان المسلمون يلعبون ويتسلَّوْن وفق قواعد منضبطة للعب الهادف \r\nالمحترف؛ فكان النبي ﷺ من عظماء مصارعي العرب، وفازت ناقته في معظم سباقات \r\nالهجن وغُلِبت تارة، وكان أئمة من التابعين من أمهر لاعبي الشطرنج في \r\nالتاريخ، وعشق علماء وأمراء السباحة والكرة والصيد وألعاب القوى. وفي هذا \r\nالمقال؛ سندخل بكم عالَم الرياضة في الحضارة الإسلامية لنستكشف ما وصلت \r\nإليه من مستوى فني محترِف تنوُّعاً وانضباطاً وتشجيعاً وانتشارا بين كافة \r\nفئات المجتمع.</p>\r\n<p align=\"right\"><strong>ميرث سابق</strong><br>\r\nعرف العرب في جاهليتهم أنواعا كثيرة من الألعاب الجماعية كانوا يمارسونها \r\nمنذ مرحلة الطفولة الأولى وحتى ما بعد البلوغ، وتذكر المعاجم العربية أسماء\r\n العشرات من هذه الألعاب؛ فقد عقَد الإمام اللغوي ابنُ سِيدَهْ الأندلسي (ت\r\n 458هـ/1067م) باباً في كتابه ‘المخصَّص‘ سمّاه: \"أسماء عامة اللهو \r\nوالملاهي\"، وأدرج فيه مبحثا عن \"اللعِب\" فذكر فيه من أسماء الألعاب 42 \r\nلعبة. ثم جاء بعده ابن منظور (ت 711هـ/1311م) فزاد عليه -في ‘لسان العرب‘- \r\nألعابا عديدة شرح كيفية لعب بعضها.</p>',1,'2020-10-06 15:28:18','2020-10-06 15:28:18'),(5,'/uploads/post/image1602327206.png','سبقها تصاعد المعارك.. دخول الهدنة حيز التنفيذ بإقليم قره باغ بين أذربيجان وأرمينيا','تصاعدت المعارك على مختلف جبهات القتال بين القوات الأذرية والأرمينية (الجزيرة)','محمد المنشاوي','/uploads/post/writerImage/image1602327223.jpg','write3@test.com',NULL,'Some Resource data',NULL,'سياسة','<p align=\"right\">دخل اتفاق وقف إطلاق النار بين أطراف النزاع في إقليم ناغورني قره باغ حيز التنفيذ بعد محادثات بين أذربيجان وأرمينيا رعتها موسكو.</p>\r\n<p align=\"right\">وكان وزير الخارجية الروسي سيرغي لافروف أعلن أن أذربيجان وأرمينيا \r\nاتفقتا في نهاية تلك المباحثات على وقف إطلاق النار في نزاعهما في الإقليم \r\nاعتبارا من ظهر اليوم السبت لدواعٍ إنسانية. وجاء إعلان لافروف بعد انتهاء \r\nمحادثات استمرت 10 ساعات مع نظيريه الأرميني والأذري في موسكو الساعة \r\nالثالثة صباحا بالتوقيت المحلي.</p>\r\n<p align=\"right\">وبينما أكد رئيس أذربيجان إلهام علييف أن بلاده غير مستعدة لتقديم أي \r\nتنازلات قالت وزارة الخارجية الأرمينية إن جدول أعمال اجتماع موسكو يتعلق \r\nفقط بوقف الأعمال القتالية والقضايا الإنسانية.</p>\r\n<p align=\"right\">وقال وزير خارجية أرمينيا زوهراب مناتساكانيان إن اتفاق موسكو يؤكد \r\nمجددا أن المنصة الوحيدة لتسوية النزاع بشأن قره باغ هي مجموعة مينسك \r\nالتابعة لمنظمة الأمن والتعاون في أوروبا.</p>\r\n<p align=\"right\">وأكد الوزير الأرميني في تصريحات للتلفزيون الوطني أنه لا يمكن لتركيا \r\nأن تلعب أي دور في تسوية النزاع بشأن الإقليم، وأضاف أن الأولوية في \r\nالعملية السياسية هي ضمان أمن الأشقاء الأرمن في قره باغ وحقهم في تقرير \r\nالمصير في إطار دولة مستقلة يعترف بها الجميع.</p>\r\n<p align=\"right\">من جهته، قال رئيس الوزراء الأرميني نيكول باشينيان إن بلاده تؤمن بمبدأ\r\n التسوية السلمية للنزاع في قره باغ، وإنها مستعدة لإعادة إطلاق العملية \r\nالسياسية الخاصة بالإقليم.</p>\r\n<p align=\"right\"><strong>الوضع الميداني</strong><br>\r\nعلى الصعيد الميداني، أفاد مراسل الجزيرة في أذربيجان بأن عددا من القذائف \r\nسقطت صباح اليوم على بلدات غوران بوي وتارتَر وأغجابيدي الحدودية الأذرية، \r\nوأضاف أن اشتباكات استمرت على طول الجبهة في إقليم قره باغ خلال الليلة \r\nالماضية بين القوات الأذرية والأرمينية.</p>',0,'2020-10-10 14:53:26','2020-10-10 15:09:10'),(6,'/uploads/post/image1604150204.png','ماكرون يتحدث للجزيرة: أتفهم مشاعر المسلمين ولا أتبنى الرسوم المسيئة','قال الرئيس الفرنسي إيمانويل ماكرون إنه يتفهم مشاعر المسلمين إزاء الرسوم المسيئة للنبي (محمد صلى الله عليه وسلم) مشددا على أن حكومته لا تقف خلف هذه الرسوم.','أيوب الريمي','/uploads/post/writerImage/image1604150204.jpg','write6@test.com','03/11/0202',NULL,NULL,'سياسة','<p style=\"direction:rtl\" align=\"right\">قال الرئيس الفرنسي إيمانويل ماكرون إنه يتفهم \r\nمشاعر المسلمين إزاء الرسوم المسيئة للنبي (محمد صلى الله عليه وسلم) مشددا\r\n على أن حكومته لا تقف خلف هذه الرسوم.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وفي مقابلة خاصة مع الجزيرة، تحدث ماكرون عن الغضب الذي أثارته الرسوم المسيئة التي نشرتها مجلة شارلي إيبدو.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وقال \"الرسوم الكاريكاتيرية ليست مشروعا حكوميا \r\nبل هي منبثقة من صحف حرة ومستقلة غير تابعة للحكومة\". وأضاف أنه يتفهم \r\nمشاعر المسلمين إزاء هذه القضية.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وكان ماكرون ذكر في وقت سابق أن فرنسا لن تتخلى \r\nعن الكاريكاتير، أثناء تعليقه على قضية قتل شاب من أصول شيشانية معلما \r\nفرنسيا عرض على تلاميذه رسوما مسيئة لنبي الإسلام والإنسانية صلى الله عليه\r\n وسلم.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وأثار تصريح ماكرون غضبا عارما في العالم \r\nالإسلامي، خصوصا وأنه جاء بعد أيام فقط من تصريح آخر قال فيه إن الدين \r\nالإسلامي يعيش أزمة في كل مكان.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وفي المقابلة التي ستبث في وقت لاحق، قال ماكرون \r\n\"أعتقد أن ردود الفعل كان مردها أكاذيب وتحريف كلامي ولأن الناس فهموا أنني\r\n مؤيد لهذه الرسوم\". وأضاف \"هناك أناس يحرّفون الإسلام وباسم هذا الدين \r\nيدّعون الدفاع عنه\".</p>\r\n<p style=\"direction:rtl\" align=\"right\">وقال ماكرون إن المسلمين هم الأكثر تضررا من تصرف هؤلاء الذين يحرفون الإسلام.</p>\r\n<p style=\"direction:rtl\" align=\"right\">ويأتي تشديد ماكرون على ان الحكومة لا تتبنى \r\nالرسوم المسيئة وسط تنامي حملة شعبية في العالم الإسلامي لمقاطعة المنتجات \r\nالفرنسية، وبعد يومين من هجوم في نيس خلف ثلاثة قتلى وعدة جرحى</p><h2 style=\"direction:rtl\" align=\"right\"><strong>مزيد من الهجمات</strong></h2>\r\n<p style=\"direction:rtl\" align=\"right\">وفي وقت سابق، قال وزير الداخلية جيرالد دارمانان\r\n إن هناك احتمالا بوقوع مزيد من الهجمات في الأراضي الفرنسية. وأضاف \"نحن \r\nفي حرب وفي مواجهة عدو خارجي وداخلي، وفي مواجهة الأيديولوجية الإسلاموية\".</p>\r\n<p style=\"direction:rtl\" align=\"right\">ولكنه رأى أنه لا ضرورة لتغيير الدستور لحماية الفرنسيين من الهجمات الإرهابية.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وصرح قائد الشرطة في مدينة نيس الفرنسية الجمعة بأن المواقع المسيحية والحكومية الفرنسية معرضة لهجمات المتشددين.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وأضاف ريشار جانوتي لرويترز \"نحن في وضع يتمدد \r\nفيه الخطر الإرهابي أكثر وأكثر. أي رمز للجمهورية أو المسيحية هدف محتمل\". \r\nوأضاف \"يتعين علينا توخي الحذر. يتعين علينا الانتباه\".</p>\r\n<p style=\"direction:rtl\" align=\"right\">وقال جانوتي إن تسجيلات الشرطة المصورة ستكون شديدة الأهمية للمحققين مع وجود 3300 كاميرا أمنية في الشوارع.</p>\r\n<p style=\"direction:rtl\" align=\"right\">وتابع \"سيستخدم المحققون جميع تسجيلاتنا المصورة، وسيكون لذلك دور حاسم في مساعدة المحققين\".</p><p style=\"direction:rtl\" align=\"right\"><br></p>',1,'2020-10-31 17:16:44','2020-10-31 17:16:44'),(8,'/uploads/WriteWithUs/image1604154334.png','لندن تترقب الانتخابات بقلق.. ترامب وبايدن أيهما أفضل لبريطانيا؟','\"الحليف الأقرب\" هي العبارة التي درج على ترديدها الدبلوماسيون في واشنطن ولندن، لوصف العلاقات بين الولايات المتحدة الأميركية وبريطانيا، ا.','أيوب الريمي',NULL,'writer7@email.com',NULL,NULL,0,'سياسة','<p style=\"text-align: right;\">\"الحليف الأقرب\" هي العبارة التي درج على ترديدها الدبلوماسيون في واشنطن ولندن، لوصف العلاقات بين الولايات المتحدة الأميركية وبريطانيا، التي تشهد صعودا وهبوطا حسب اللون السياسي الذي يقود المملكة المتحدة، وشخصية ساكن البيت الأبيض، لكن أصولها ثابتة وراسخة رغم الهزات العنيفة التي تحدث أحيانا.</p>\r\n<p style=\"text-align: right;\">وبكثير من الترقب، تتابع المملكة المتحدة، مجريات الانتخابات الرئاسية الأميركية، بالنظر للظرف غير المسبوق الذي تمر بريطانيا، فهي تعد آخر أيامها قبل الخروج نهائيا من الاتحاد الأوروبي، وتواجه جائحة كورونا، وأخيرا تحاول إتمام الاتفاق التجاري الأضخم في تاريخها مع الولايات المتحدة، ما يجعل من هذه الأيام، أياما تاريخية في المملكة المتحدة.</p>\r\n<p style=\"text-align: right;\">ويلح سؤال أيهما أفضل لبريطانيا جو بايدن أم دونالد ترامب؟ على الكثير من مراكز الدراسات البريطانية، وصناع القرار، ويمكن القول إن لكل مرشح نقاطا إيجابية ستفيد بريطانيا في أيامها العصيبة هذه، وأخرى ربما تعقّد مهمة الخروج من عنق الزجاجة على حكومة بوريس جونسون.</p>\r\n<p style=\"text-align: right;\"><img class=\"size-fantasia-770 wp-image-2244074\" src=\"https://www.aljazeera.net/wp-content/uploads/2020/01/fa0fd2f9-b5ff-472a-b49c-1fa0b6168d33.jpeg?w=770&amp;resize=770%2C433\" data-recalc-dims=\"1\" /></p>',1,'2020-10-31 18:25:34','2020-10-31 18:25:34');
