INSERT INTO `write_with_us` VALUES (5,'أيوب الريمي','writer7@email.com','لندن تترقب الانتخابات بقلق.. ترامب وبايدن أيهما أفضل لبريطانيا؟','\"الحليف الأقرب\" هي العبارة التي درج على ترديدها الدبلوماسيون في واشنطن ولندن، لوصف العلاقات بين الولايات المتحدة الأميركية وبريطانيا، التي تشهد صعودا وهبوطا حسب اللون السياسي الذي يقود المملكة المتحدة، وشخصية ساكن البيت الأبيض، لكن أصولها ثابتة وراسخة رغم الهزات العنيفة التي تحدث أحيانا.','سياسة','<p style=\"text-align: right;\">\"الحليف الأقرب\" هي العبارة التي درج على ترديدها الدبلوماسيون في واشنطن ولندن، لوصف العلاقات بين الولايات المتحدة الأميركية وبريطانيا، التي تشهد صعودا وهبوطا حسب اللون السياسي الذي يقود المملكة المتحدة، وشخصية ساكن البيت الأبيض، لكن أصولها ثابتة وراسخة رغم الهزات العنيفة التي تحدث أحيانا.</p>\r\n<p style=\"text-align: right;\">وبكثير من الترقب، تتابع المملكة المتحدة، مجريات الانتخابات الرئاسية الأميركية، بالنظر للظرف غير المسبوق الذي تمر بريطانيا، فهي تعد آخر أيامها قبل الخروج نهائيا من الاتحاد الأوروبي، وتواجه جائحة كورونا، وأخيرا تحاول إتمام الاتفاق التجاري الأضخم في تاريخها مع الولايات المتحدة، ما يجعل من هذه الأيام، أياما تاريخية في المملكة المتحدة.</p>\r\n<p style=\"text-align: right;\">ويلح سؤال أيهما أفضل لبريطانيا جو بايدن أم دونالد ترامب؟ على الكثير من مراكز الدراسات البريطانية، وصناع القرار، ويمكن القول إن لكل مرشح نقاطا إيجابية ستفيد بريطانيا في أيامها العصيبة هذه، وأخرى ربما تعقّد مهمة الخروج من عنق الزجاجة على حكومة بوريس جونسون.</p>\r\n<p style=\"text-align: right;\"><img class=\"size-fantasia-770 wp-image-2244074\" src=\"https://www.aljazeera.net/wp-content/uploads/2020/01/fa0fd2f9-b5ff-472a-b49c-1fa0b6168d33.jpeg?w=770&amp;resize=770%2C433\" data-recalc-dims=\"1\" /></p>','/uploads/WriteWithUs/image1604151068.png',0,'2020-10-31 17:20:07','2020-10-31 17:31:08');
